int str_to_int(char *str) {
    int result = 0;
    int i = 0;
    while (str[i] != '\0' && str[i] >= '0' && str[i] <= '9') {
        result = result * 10 + str[i] - '0';
        i++;
    }
    return result;
}

void mona_lisa_main(char *args) {
    if(args[0] == '\0'){
        syscall(USER_ENVIRONMENT_API_SYSCALL, PRINT_STRING_ENDPOINT, "Usage: mona_lisa <scale (range 1-15)>\n", 0, 0, 0);
        return;
    }
    // get scale from arguments
    int desired_scale = 1;
    if (args[0] != '\0' && args[0] >= '0' && args[0] <= '9') {
        desired_scale = str_to_int(args);
    }

    if(desired_scale < 1 || desired_scale > 15){
        desired_scale = 5;
    }

    Point position = {0};

    int screen_width = getScreenWidth();
    int screen_height = getScreenHeight();

    int scale = 1;
    while (1) {
         // Center the image
        position.x = (screen_width - width * scale) / 2;
        position.y = (screen_height - height * scale) / 2;

        // Draw the Mona Lisa image
        drawBitmap(mona_lisa, width, height, position, scale);

        if(scale == desired_scale){
            break;
        }

        scale ++;
        syscall(SLEEP_SYSCALL, 100, 0, 0, 0, 0);
    }

    // Wait for a key press
    char c = get_char_from_stdin();
    while(1){
        if (c != 0) {
            break;
        }
        c = get_char_from_stdin();
    }
}